function go() {
    let net1 = document.getElementById("net1").value;
    let net2 = document.getElementById("net2").value;
    let net3 = document.getElementById("net3").value;
    let prev1 = document.getElementById("prev1").value;
    let prev2 = document.getElementById("prev2").value;
    let prev3 = document.getElementById("prev3").value;
    let matchUpSub = document.getElementById("sub").value;
    let required = document.getElementById("required").value;
    document.getElementById("results").innerHTML = "";
    document.getElementById("error-text").innerHTML = "";
    if (!isValid(net1, net2, net3, prev1, prev2, prev3, matchUpSub, required)) {
        document.getElementById("error-text").innerHTML = "Error";
        return;
    }
    let [hash, order] = getHashAndOrder(net1, net2, net3);
    console.log(hash);
    console.log(order);
    let badPairs = [];
    if (prev1.length === 2) {
        badPairs.push(sortPair(prev1));
    }
    if (prev2.length === 2) {
        badPairs.push(sortPair(prev2));
    }
    if (prev3.length === 2) {
        badPairs.push(sortPair(prev3));
    }
    let res = getAllMatchups(hash, order, matchUpSub, badPairs, sortPair(required));
    for (r of res) {
        let node = document.createElement("li");
        let text = document.createTextNode(r);
        node.appendChild(text);
        document.getElementById("results").appendChild(node);
    }
    console.log(res);
}

function getHashAndOrder(net1, net2, net3) {
    let nets = [net1, net2, net3];
    let sorted = [];
    for (let idx in nets) {
        sorted.push(sortPair(nets[idx]) + idx); // Include index to determine order
    }
    sorted.sort();
    let hash = sorted[0].substring(0, 2) + sorted[1].substring(0, 2) + sorted[2].substring(0, 2);
    let order1 = parseInt(sorted[0].charAt(2));
    let order2 = parseInt(sorted[1].charAt(2));
    let order3 = parseInt(sorted[2].charAt(2));
    let order = [order1, order2, order3];
    return [hash, order];
}

function isValid(net1, net2, net3, prev1, prev2, prev3, sub, required) {
    if (!isValidLength(net1, 2) || !isValidLength(net2, 2) || !isValidLength(net3, 2)) {
        return false;
    }
    if (!isValidLength(prev1, 2, true) || !isValidLength(prev2, 2, true) || !isValidLength(prev3, 2, true) || !isValidLength(required, 2, true)) {
        return false;
    }
    if (!isValidLength(sub, 1, true)) {
        return false;
    }
    if (sub.length === 1) {
        if (parseInt(sub) < 1 || parseInt(sub) > 7) {
            return false;
        }
    }
    let nets = [net1, net2, net3];
    let arr = [];
    for (let net of nets) {
        for (let i = 0; i < 2; i++) {
            let num = parseInt(net.charAt(i));
            if (num < 1 || num > 7 || arr[num] === true) {
                return false;
            }
            arr[num] = true;
        }
    }
    return true;
}

function isValidLength(str, len, allowEmptyString) {
    if (str == null || str.length === 0) {
        return allowEmptyString === true;
    }
    console.log(str);
    return str.length === len && isNumeric(str);
}

function sortPair(net) {
    if (net.length === 0) {
        return net;
    }
    let a = parseInt(net.charAt(0));
    let b = parseInt(net.charAt(1));
    if (a < b) {
        return net;
    }
    return ""+b+a;
}


function isNumeric(str) {
    return /^\d+$/.test(str);
}

